import React from 'react';
import {getKatData} from '../util/dao'

export class Generator extends React.Component {
    constructor(props) {
        super(props);
    }
    _generateKat (e) {
        e.preventDefault();
        const data = getKatData();
        data.then(r => {
            console.log("data in promise", r["face"]);
        })
        console.log("response in component", data);
    }
    render () {
        return (
            <div>
                <button onClick={(e) => this._generateKat(e)}>Generate Kat</button>
            </div>
        )
    }
}
